import React,{Component} from "react"
import Header from "../../component/Header/Header"
import store from "../../store/index"
import "./index.css"


console.log(store.getState());

class Mine extends Component{
    constructor(props){
        super(props);
    }

    wwwchange(){
        console.log(1);
        store.dispatch({
            type:'WWW'
        });
    }
    nnnchange(){
        console.log(2);
        store.dispatch({
            type:'NNN'
        });
    }
    componentDidMount(){
        store.subscribe(()=>{
            this.setState({
                title:store.getState().mineReducer.title
            });

        });
    }
    render(){
        return(
            <div className="mine">
                <Header title={store.getState().mineReducer.title}/>
                {store.getState().mineReducer.title}
                <button onClick={this.wwwchange.bind(this)}>点击www</button>
                <button onClick={this.nnnchange.bind(this)}>点击nnn</button>
            </div>
        )
    }
}
export default Mine
